}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"	 viewBox="0 0 24 24" xml:space="preserve"><polygon class="aw-theme-iconOutline" fill="#464646" points="15.6,10.6 12,14.3 12,1 11,1 11,14.3 7.4,10.6 6.6,11.4 11.5,16.2 16.4,11.4 "/><polygon class="aw-theme-iconOutline" fill="#464646" points="21,24 2,24 2,7 7,7 7,8 3,8 3,23 20,23 20,8 16,8 16,7 21,7 "/></svg>';
